import { Hono } from 'hono';
import { ImageResponse } from 'workers-og';
import { html as toReactNode } from 'satori-html';

export type Env = {
	BG_ENDPOINT: string;
};

// Start a Hono app
const app = new Hono<{ Bindings: Env }>();

app.get('/', () => {
	return new Response('Hello, World!');
});

app.get('/og', async (c) => {
	const bg64 =
		'data:image/png;base64,';

	const font64 =
		'';

	// Extract the query parameters from the request URL
	const title = c.req.query('title');
	const desc = c.req.query('desc');

	// If either parameter is missing, return a 400 error
	if (!title || !desc) {
		return c.json({ error: 'Both title and desc parameters are required' }, 400);
	}

	// Decode the URI components to handle special characters
	const decodedTitle = decodeURIComponent(title);
	const decodedDesc = decodeURIComponent(desc);

	const html = `<div style="display: flex; flex-direction: column; justify-content: center; align-items: flex-end; height: 100%; width: 100%; padding: 2rem; position: relative; background-image: url(${bg64});"><p style="color: rgb(248, 250, 252); font-size: 4.5rem; line-height: 0.7rem;">${decodedTitle}</p> <p style="color: rgb(98, 98, 98); font-size: 2.25rem;">${decodedDesc}</p></div>`;

	const element = toReactNode(html);

	const res = new ImageResponse(element, {
		fonts: [
			{
				name: 'ABC Monument Grotesk',
				weight: 400,
				style: 'normal',
				data: Uint8Array.from(atob(font64), (c) => c.charCodeAt(0))
			}
		],
		width: 1200,
		height: 630,
		debug: true,
		headers: {
			'Cache-Control': 'public, max-age=600',
			'Content-Type': 'image/png'
		}
	});

	console.log(title);

	return res;
});

// Export the Hono app
export default app;
